	@Mod.EventHandler
	public void preInit(FMLPreInitializationEvent event) {
		LepidodendronConfig.load(event);
		LepidodendronConfigPlants.load(event);
		MinecraftForge.EVENT_BUS.register(this);
		GameRegistry.registerWorldGenerator(elements, 5);
		GameRegistry.registerFuelHandler(elements);
		NetworkRegistry.INSTANCE.registerGuiHandler(this, new ElementsLepidodendronMod.GuiHandler());
		elements.preInit(event);
		MinecraftForge.EVENT_BUS.register(elements);
		elements.getElements().forEach(element -> element.preInit(event));
		EntityRegistries.registerEntities();
		proxy.preInit(event);
	}

	@Mod.EventHandler
	public void init(FMLInitializationEvent event) {
		elements.getElements().forEach(element -> element.init(event));
		proxy.init(event);

		MinecraftForge.TERRAIN_GEN_BUS.register(new LepidodendronDecorationHandler());
		MinecraftForge.TERRAIN_GEN_BUS.register(new LepidodendronBespokeSpawner());
		MinecraftForge.ORE_GEN_BUS.register(new LepidodendronOreHandler());
		MinecraftForge.EVENT_BUS.register(new LepidodendronEventSubscribers());
		MinecraftForge.EVENT_BUS.register(new LepidodendronBookSubscribers());
		MinecraftForge.EVENT_BUS.register(new LepidodendronDimensionalSleeping());
		MinecraftForge.EVENT_BUS.register(new LepidodendronFogSubscribers());
		MinecraftForge.EVENT_BUS.register(new LepidodendronMissingMappingsEventHandler());
		MinecraftForge.EVENT_BUS.register(new LepidodendronHoeHandler());
		MinecraftForge.EVENT_BUS.register(new LepidodendronBucketHandler());
		MinecraftForge.EVENT_BUS.register(new LepidodendronGlassBottleSubscribers());

		ModTriggers.registerTriggers();
		LootConditionManager.registerCondition(new EntityInDimensionName.Serializer());
		LootConditionManager.registerCondition(new EntityInDimensionID.Serializer());
		LootConditionManager.registerCondition(new EntityInBiomes.Serializer());

		ModFixs modfixes = FMLCommonHandler.instance().getDataFixer().init("lepidodendron", 59);
		modfixes.registerFix(FixTypes.ENTITY, FixerPalaeodictyoptera.FixerPalaeodictyoptera);
		modfixes.registerFix(FixTypes.ENTITY, FixerPalaeodictyopteraNymph.FixerPalaeodictyopteraNymph);
		modfixes.registerFix(FixTypes.ENTITY, FixerTitanoptera.FixerTitanoptera);
		modfixes.registerFix(FixTypes.ENTITY, FixerTitanopteraNymph.FixerTitanopteraNymph);
		modfixes.registerFix(FixTypes.ENTITY, FixerConodont.FixerConodont);

		RecipeOresAndBlocks.registerSmelting();
		RecipeCookedMeatsandSeeds.registerSmelting();
	}

	@Mod.EventHandler
	public void postInit(FMLPostInitializationEvent event) {
		proxy.postInit(event);
	}

	@Mod.EventHandler
	public void serverLoad(FMLServerStartingEvent event) {
		elements.getElements().forEach(element -> element.serverLoad(event));
		proxy.serverLoad(event);
		//event.registerServerCommand(new Summoner());
	}

	@SubscribeEvent
	public void registerVillagers(RegistryEvent.Register<VillagerRegistry.VillagerProfession> event) {
		event.getRegistry().registerAll(VillagerPalaeobotanist.PALAEOBOTANIST_PROFESSION);
		VillagerPalaeobotanist.register();
		event.getRegistry().registerAll(VillagerPalaeontologist.PALAEONTOLOGIST_PROFESSION);
		VillagerPalaeontologist.register();
	}

	@SubscribeEvent
	public void registerEnchantments(RegistryEvent.Register<Enchantment> event) {
		event.getRegistry().registerAll(Enchantments.TIME_REVERSAL);
	}

	@SubscribeEvent
	public void registerBlocks(RegistryEvent.Register<Block> event) {
		event.getRegistry().registerAll(elements.getBlocks().stream().map(Supplier::get).toArray(Block[]::new));

		if (LepidodendronConfig.modFire) {
			BlockFirePF newFire = (BlockFirePF) (new BlockFirePF()).setHardness(0.0F).setLightLevel(1.0F).setTranslationKey("fire").setRegistryName(Objects.requireNonNull(Blocks.FIRE.getRegistryName()));
			event.getRegistry().register(newFire);
		}
	}

	@SubscribeEvent
	public void registerItems(RegistryEvent.Register<Item> event) {
		event.getRegistry().registerAll(elements.getItems().stream().map(Supplier::get).toArray(Item[]::new));
		//event.getRegistry().registerAll(ArmorInit.ARMOR);
	}

	@SubscribeEvent
	public void registerBiomes(RegistryEvent.Register<Biome> event) {
		event.getRegistry().registerAll(elements.getBiomes().stream().map(Supplier::get).toArray(Biome[]::new));
	}

	@SubscribeEvent
	public void registerEntities(RegistryEvent.Register<EntityEntry> event) {
		event.getRegistry().registerAll(elements.getEntities().stream().map(Supplier::get).toArray(EntityEntry[]::new));
	}

	@SubscribeEvent
	public void registerPotions(RegistryEvent.Register<Potion> event) {
		event.getRegistry().registerAll(elements.getPotions().stream().map(Supplier::get).toArray(Potion[]::new));
	}

	@SubscribeEvent
	public void registerSounds(RegistryEvent.Register<net.minecraft.util.SoundEvent> event) {
		elements.registerSounds(event);
	}

	@SubscribeEvent
	@SideOnly(Side.CLIENT)
	public void registerModels(ModelRegistryEvent event) {
		elements.getElements().forEach(element -> element.registerModels(event));
	}
